vec3 rgb( in vec3 vec )
{
    return vec3(vec.x / 255.0, vec.y / 255.0, vec.z / 255.0);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord / iResolution.xy;
    uv = uv * 2.0 - 1.0;
    uv.x *= iResolution.x / iResolution.y;

    float dist = cos(length(uv)) * iTime * 10.0;
    dist = sin(dist * 10.0 + iTime) / 10.0;
    dist = (pow(abs(sin(iTime)), 4.0) * 0.1 + .05) / dist;

    fragColor = vec4(dist, dist * abs(cos(iTime * 0.25)), abs(sin(iTime * 0.5)), 1.0);
}
